import Link from 'next/link'

function HomePage() {
  return (
    <div>
      <Link href="/[pid]" as="/about">
        <a> Home </a>
      </Link>
      <Link href="/about">
        <a> About </a>
      </Link> 
    </div>
  );
}
const pid = 'asdf'
export default HomePage;
